using System;
using System.Threading.Tasks;
using MosaicApp.ImageProcessing;

namespace MosaicApp
{
    public class Application
    {
        private readonly IImageProcessingService _imageProcessingService;

        public Application(IImageProcessingService imageProcessingService)
        {
            _imageProcessingService = imageProcessingService;
        }

        public async Task RunAsync()
        {
            var imageMosaic = await _imageProcessingService.MosaicProcessAsync(new MosaicProcessParam()
            {
                Base64 = Base64,
                StartPoint = "219,138",
                EndPoint = "318,269"
            });
            Console.WriteLine("Mosaic:");
            Console.WriteLine(imageMosaic);

            var imageMark = await _imageProcessingService.MarkProcessAsync(new MarkProcessParam()
            {
                Base64 = Base64,
                Mark = "@MarkTest"
            });
            Console.WriteLine("Mark:");
            Console.WriteLine(imageMark);
        }

        private const string Base64 =
            @"data:image/jpg;base64,";
    }
}